import React from 'react';
import cardData from '../data/employee.json';

const Card = () => {
  return (
    <div className='w-2/4'>
        <div className="flex justify-between mb-4">
            <div className="flex items-center">
            <div className="w-16 h-16 rounded-full bg-gray-200"></div>
            <div className="ml-4">
                <div className="w-40 h-6 bg-gray-200 mb-2"></div>
                <div className="w-20 h-4 bg-gray-200"></div>
            </div>
            </div>
            <div className="w-16 h-8 bg-gray-200"></div>
        </div>
        <div className="w-32 h-4 bg-gray-200 mb-2"></div>
        <div className="w-64 h-4 bg-gray-200 mb-2"></div>
        <div className="w-48 h-4 bg-gray-200 mb-2"></div>
        <div className="w-56 h-4 bg-gray-200"></div>
    </div>
  );
}

export default Card;
